import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

ReactDOM.render(
  <div>
    <h1>Titulo</h1>
    <div>Hola desde react</div>
  </div>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
